# -*- coding: utf-8 -*-
import tkinter as tk
from tkinter import filedialog, ttk
import cv2
import numpy as np
from PIL import Image, ImageTk
from ultralytics import YOLO

model_co = YOLO('yolov8n-seg.pt')
model = YOLO('best.pt')  # 这里放权重路径


class App:
    def __init__(self, root):
        self.root = root
        self.root.title("测测你像哪位动漫角色")
        # self.root.geometry("500x600")

        self.style = ttk.Style()
        self.style.configure('TButton', padding=6, relief="flat", background="#ccc")
        self.style.map('TButton', foreground=[('pressed', 'red'), ('active', 'blue')])

        self.label = tk.Label(root, text="                上传图片进行预测                ", font=("等线", 18))
        self.label.pack(pady=10)

        self.load_button = ttk.Button(root, text="选择图片", command=self.load_image)
        self.load_button.pack(pady=10)

        self.predict_button = ttk.Button(root, text="开始预测", command=self.predict)
        self.predict_button.pack(pady=10)

        self.result_label = tk.Label(root, text="", font=("等线", 14))
        self.result_label.pack(pady=10)

        self.image_path = ""

    def load_image(self):
        self.image_path = filedialog.askopenfilename(filetypes=[("Image files", "*.jpg;*.jpeg;*.png")])

        if self.image_path:
            # 显示选择的图片，并进行缩放
            imgsize = 500  # 设置缩放大小
            image = Image.open(self.image_path)
            height, width = image.size
            if (width > height):
                image = image.resize((int(imgsize * height / width), imgsize), Image.BICUBIC)
            else:
                image = image.resize((imgsize, int(imgsize * width / height)), Image.BICUBIC)

            image = ImageTk.PhotoImage(image)
            self.label.config(image=image)
            self.label.image = image

    def process_image(self, image):
        results = model_co.predict(source=image)[0]

        if results.boxes is None:
            return "未检测到物体。"

        indexes = np.where(results.boxes.cls.numpy() == 0)[0]
        if len(indexes) == 0:
            img = cv2.imread(self.image_path)
            pred = model.predict(source=img)[0]

            top5_indices = pred.probs.top5[:3]
            if pred.probs.data.max() < 0.50:
                r = [f'{name_dict[i]}' for i in top5_indices if i in name_dict]
            else:
                r = [f'{name_dict[i]}:{format(pred.probs.data[i] * 100, ".2f")}%' for i in top5_indices if i in name_dict]

            return '我觉得有可能是：\n' + '\n'.join(r)
        

        pixel_xy = results.masks.xy[indexes[0]]
        points = np.array(pixel_xy, np.int32)
        input_image = cv2.imread(self.image_path)
        black_background = np.zeros_like(input_image)
        cv2.fillPoly(black_background, [points], (255, 255, 255))
        masked_image = cv2.bitwise_and(input_image, black_background)
        cv2.imwrite('img_cold.jpg', masked_image)
        img = cv2.imread('img_cold.jpg')
        pred = model.predict(source=img)[0]

        top5_indices = pred.probs.top5[:3]
        r = [f'{name_dict[i]}:{format(pred.probs.data[i] * 100, ".2f")}%' for i in top5_indices if i in name_dict]

        if pred.probs.data.max() < 0.50:
            img = cv2.imread(self.image_path)
            pred = model.predict(source=img)[0]
            r = [f'{name_dict[i]}' for i in top5_indices if i in name_dict]
            # return '我觉得有可能是：\n' + '\n'.join(r)

        return '我觉得有可能是：\n' + '\n'.join(r)


    def predict(self):
        if self.image_path:
            image = Image.open(self.image_path)
            result = self.process_image(image)
            self.result_label.config(text=result)


